  for j = 2:ny-1
    u_zz(j,:) = -0.5*(c(j,:)+c(j-1,:)).*u(j-1,:) + 0.5*(c(j+1,:)+2*c(j,:)+c(j-1,:)).*u(j,:)...
      - 0.5*(c(j,:)+c(j+1,:)).*u(j+1,:);
  end
  
  u_zz(1,:) = 0.5*(c(1,:)+c(2,:)) .* (u(1,:) - u(2,:));
  u_zz(end,:) = 0.5*(c(end-1,:)+c(end,:)) .* (u(end,:) - u(end-1,:));
  
  muBSy(1,:) = -c(1,:).*(-u(1,:) + u(2,:))./h;
  muBSy(end,:) = c(end,:).*(-u(end-1,:) + u(end,:))./h;

  u_zz(1,:) = 2/h*(-u_zz(1,:)./h^2 + muBSy(1,:));
  u_zz(2:end-1,:) = 1/h*(-u_zz(2:end-1,:)./h^2);
  u_zz(end,:) = 2/h*(-u_zz(end,:)./h^2 + muBSy(end,:));

end




